import React  from 'react';
import styled from 'styled-components';
import {FaPhoneAlt,FaRegEnvelope} from 'react-icons/fa';


const MainContectSection=styled.div`
width           : 100%;
height          : 80vh;
background-color: whitesmoke;

`;

const Cards=styled.div`
width: 100%;
height: 130px;
background-color: violet;
margin-top: 7%;

`;

const SmallCards=styled.div`
 width: 300px;
 background-color: whitesmoke;
 height: 90px;
 margin-left: 20px;
 margin-top: 20px;
 border-radius: 10px;
 display: flex;
 justify-content: start;
 align-items: center;
 -webkit-box-shadow: -9px 10px 12px 1px rgba(0,0,0,0.82); 
box-shadow: -9px 10px 12px 1px rgba(0,0,0,0.82);
`;

const Imageive=styled.div`
width: 80px;
padding-left: 20px;
`;
const ContentDiv=styled.div`
padding-left: 30px;
text-align: center;
padding-top: 20px;

h4{
    font-style: italic;
    font-size: 16px;
}
p{
    
font-size: 15px;
}
`;
const Contact = () => {
    return (
       
<MainContectSection>
         <Cards>
         <div class = "container">
         <div class = "row">
         <div class = "col-sm">
             <SmallCards>
                 <Imageive>
                 <FaPhoneAlt style={{width:'50px'}}/>
                 </Imageive>
                 <ContentDiv>
                 <h4>Phone</h4>
                 <p>+92 032287161</p>
                 </ContentDiv>
               
             </SmallCards>
         </div>
        <div class = "col-sm">
            <SmallCards>
                <Imageive>
                <FaRegEnvelope style={{width:'50px'}}/>
                </Imageive>
                <ContentDiv  style={{paddingLeft:'0px'}} >
                <h4  style={{paddingRight:'20px'}}>Support Mail</h4>
                 <p>Support@SpinzerBurger.com</p>

                </ContentDiv>
                
            </SmallCards>
        </div>
        <div class = "col-sm">
            <SmallCards>

            </SmallCards>
        </div>
        </div>
        </div>
         </Cards>
</MainContectSection>
    )
}

export default Contact
